INSERT INTO `catalog_pages` VALUES (97, 221, 'pets', 'bear_cubs', 'Bärenjunge', 6, 228, 1, 0, 1, '1', '1', '0', '0', '', '', '', 'catalog_pet_headline1', '', '', '', '');
INSERT INTO `catalog_pages` VALUES (98, 221, 'pets', 'terrier_puppies', 'Terrier Welpen', 6, 228, 1, 0, 4, '1', '1', '0', '0', '', '', '', 'catalog_pet_headline1', '', '', '', '');
INSERT INTO `catalog_pages` VALUES (99, 221, 'pets', 'kittens', 'Kätzchen', 1, 20, 1, 0, 3, '1', '1', '0', '0', '', 'Name your pet:', '', 'catalog_pet_headline1', '', 'Diese flauschigen Pelzknäuel springen durch das Hotel und sind hier, um Ihr Herz zu stehlen... und Ihr Garn!', '', '');
INSERT INTO `catalog_pages` VALUES (100, 221, 'pets', 'puppies', 'Welpen', 1, 24, 1, 0, 5, '1', '1', '0', '0', '', 'Name your pet:', '', 'catalog_pet_headline1', '', 'So weich und kuschelig, werden diese verspielten Welpen sicher Ihr Herz schmelzen lassen. Von Labradors bis Dalmatinern gibt es für jeden eine Rasse!', '', '');
INSERT INTO `catalog_pages` VALUES (101, 221, 'pets', 'piglets', 'Ferkel', 1, 67, 1, 0, 2, '1', '1', '0', '0', '', 'Name your pet:', '', 'catalog_pet_headline1', '', 'GRUNZEN! Teilweise zu einer guten Rolle im Schlamm, haben diese verspielten Schweinchen ins Hotel getrottet und sind bereit für Spaß!', '', '');
INSERT INTO `catalog_pages` VALUES (102, 277, 'single_bundle', 'velociraptor', 'Haustier Velociraptos', 1, 260, 1, 0, 12, '1', '1', '0', '0', '', '', '', 'jurassic15_catalog_header', 'dino_pets', 'Schnell und hinterhältig haben diese Reptilien den Ruf, etwas pflegeleicht, unglaublich intellektuell und endlos lästig zu sein! Sie werden oft feststellen, dass sie über tief philosophische Fragen nachdenken oder die schönen Dinge des Lebens genießen, wie Pediküre und Fleisch direkt vom Knochen.', '', '');
INSERT INTO `catalog_pages` VALUES (104, 209, 'default_3x3', 'drago', 'Drache', 1, 110, 1, 0, 23, '1', '1', '0', '0', '', '', '', 'drago_catalog_header2', 'drago_catalog_teaser2', 'Dungeon-Möbel, das perfekte Sortiment, um Ihre gewundenen Keller zu schaffen!', '', '');
INSERT INTO `catalog_pages` VALUES (106, 209, 'default_3x3', 'boutique', 'Laden', 1, 954, 1, 0, 69, '1', '1', '0', '0', '', '', '', 'boutique_catalog_01', 'boutique_catalog_teaser_01', 'Das Boutique-Sortiment ist ideal, wenn Sie ein High-End-Modegeschäft in Mailand haben möchten, aber ein begrenztes Budget haben.', '', '');
INSERT INTO `catalog_pages` VALUES (107, 2, 'guilds', 'habbo_groups', 'Gruppen', 1, 203, 1, 0, 17, '1', '1', '0', '0', NULL, '', 'What\'s So Great About Habbo Groups?', 'catalog_groups_en', 'catalog_groupsteaser_en', 'Habbo-Gruppen sind eine großartige Möglichkeit, mit deinen Freunden in Kontakt zu bleiben und deine Interessen mit anderen zu teilen. Jede Gruppe hat eine Lounge, die von anderen Gruppenmitgliedern dekoriert werden kann, Mitglieder können auch exklusive Möbel für die Gruppe kaufen, die mit den Farben ihrer Gruppe angepasst werden können.', '', '');
INSERT INTO `catalog_pages` VALUES (108, 107, 'guild_furni', 'group_furni', 'Gruppe Furni', 1, 927, 1, 0, 1, '1', '1', '0', '0', NULL, '', '', 'catalog_groups_en', '', 'Zeige deinen Gruppengeist mit den neuen anpassbaren Möbeln. Wähle deine Gruppe und erhalte dann deine Möbel in den Farben deiner Gruppe.', 'guild_custom_furni', '');
INSERT INTO `catalog_pages` VALUES (109, 209, 'default_3x3', 'youtube', 'Youtube-Seite', 1, 188, 1, 0, 128, '1', '1', '0', '0', '', '', '', 'catalog_header_tv', 'yttv', 'Erinnerst du dich, als Habbo YouTube-Fernseher hatte? Nun, Sie können es wieder mit KrewsTube tun! ', '', '');
INSERT INTO `catalog_pages` VALUES (110, 209, 'default_3x3', 'vikings', 'Wikinger', 1, 208, 1, 0, 125, '1', '1', '0', '0', '', '', '', 'vikings_catalog_header', 'catalog_teaser_vikings', 'Von Waffenständern und Stachelköpfen bis hin zu kunstvollen handgeschnitzten Holzstühlen und -bänken. Diese Einrichtung hat alles, was Sie brauchen und mehr, um das Wikingerdorf Ihrer Träume zu schaffen. Mit den Furnis in den Clanfarben kannst du deine wahre Treue mit Stolz zeigen!', '', '');
INSERT INTO `catalog_pages` VALUES (111, 209, 'default_3x3', 'palooza', 'Festival', 1, 227, 1, 0, 32, '1', '1', '0', '0', NULL, '', '', 'catalog_teaser_palooza', 'catalog_teaser_palooza', 'Gestalten Sie Ihre eigene Outdoor-Bühne und Ihren eigenen Festivalbereich. Wir haben Bühnen, Zäune und sogar Verkaufsautomaten!', '', '');
INSERT INTO `catalog_pages` VALUES (112, 209, 'default_3x3', 'wild_wild_west', 'Wilder Westen', 1, 229, 1, 0, 126, '1', '1', '0', '0', '', '', '', 'catalog_header_wwest', 'catalog_teaser_wildwest', 'Vom Shoot\'em Up Saloon über das Büro des Sheriffs bis hin zu all den Bodenfliesen, Kakteen und Tumbleweeds... Die Möbel des Wilden Westens sind in der Stadt angekommen.', '', '');
INSERT INTO `catalog_pages` VALUES (113, 387, 'default_3x3', 'club_nx', 'Club NX', 1, 927, 1, 0, 4, '1', '1', '0', '0', '', '', '', 'catalog_header_classics', 'catal_fp_pic5', 'Auf Habbo gibt es oben neben der Bar eine Tür, die zum Flur 2 führt.', '', '');
INSERT INTO `catalog_pages` VALUES (114, 209, 'default_3x3', 'habbo_university', 'Habbo Universität', 1, 230, 1, 0, 51, '1', '1', '0', '0', '', '', '', 'university_new_furni_catalog_header', 'university_catalog_teaser', 'Von pink über blumig bis hin zu Hipster-Chic: Jeder Habbo hat einen Stil.', '', '');
INSERT INTO `catalog_pages` VALUES (115, 234, 'default_3x3', 'toys_and_accessories', 'Spielzeug & Zubehör', 1, 199, 1, 0, 5, '1', '1', '0', '0', '', NULL, 'Get some nice accessories for your pet.', 'catalog_pet_headline2', 'catalog_teaser_pettoys', 'Die Baby-Haustiere sind da! Passen Sie gut auf sie auf und halten Sie sie glücklich mit unserem aufregenden Angebot an Lebensmitteln und Spielzeug!', '', '');
INSERT INTO `catalog_pages` VALUES (116, 209, 'default_3x3', 'attic', 'Dachboden', 1, 242, 1, 0, 20, '1', '1', '0', '0', NULL, '', '', 'attic15_catalog_header', 'attic15_catalog_teaser', 'Von quietschenden Dielen bis hin zu antiken Möbeln, Attic 2015 Möbel sind hier!', '', '');
INSERT INTO `catalog_pages` VALUES (117, 222, 'default_3x3_color_grouping', 'alphabet_blocks', 'Alphabetische Blöcke', 1, 101, 1, 0, 1, '1', '1', '0', '0', NULL, '', '', 'catalog_header_alpha1', 'catalog_teaser_alpha1', 'An... B... C... und Z, Schlampe...', '', '');
INSERT INTO `catalog_pages` VALUES (118, 209, 'default_3x3', 'neo-habbo', 'Cyberpunk', 1, 254, 1, 0, 19, '1', '1', '0', '0', '', '', '', 'catalog_header_cpunk15', 'old_cypunk', 'Lichtdurchflutete Stadtlandschaften und hell erleuchtete Wolkenkratzer, die über ihren Köpfen aufragen... Dies ist die dunkle und dunkle Linie der Furnis der Zukunft. Die Zukunft heißt CyberPunk.', '', '');
