INSERT INTO `catalog_pages` VALUES (159, 387, 'default_3x3', 'infobus', 'Infobus', 1, 927, 1, 0, 13, '1', '1', '0', '0', '', '', '', 'catalog_header_classics', 'catal_fp_pic5', 'Der berühmte Infobus wurde immer nur geöffnet, wenn Mitarbeiter Veranstaltungen oder Diskussionen veranstalteten, während der Park immer geöffnet war.', '', '');
INSERT INTO `catalog_pages` VALUES (160, 387, 'default_3x3', 'game_hub', 'Spiele-Hub', 1, 927, 1, 0, 21, '1', '1', '0', '0', '', '', '', 'catalog_header_classics', 'catal_fp_pic5', 'Dieser Raum war die wichtigste Zusammenarbeit von Spielen und Veranstaltungen zwischen Benutzern und offiziellen Habbo-Mitarbeitern.', '', '');
INSERT INTO `catalog_pages` VALUES (161, 209, 'default_3x3', 'paris', 'Paris', 1, 261, 1, 0, 83, '1', '1', '0', '0', '', '', '', 'paris_header', 'paris_teaser', 'Wollten Sie schon immer ein Zimmer bauen, das in Paris entworfen wurde? Jetzt ist Ihre Chance mit diesem neuen Pariser Möbelset.', '', '');
INSERT INTO `catalog_pages` VALUES (162, 387, 'default_3x3', 'hall_of_habbo', 'Halle von Habbo', 1, 927, 1, 0, 9, '1', '1', '0', '0', '', '', '', 'catalog_header_classics', 'catal_fp_pic5', 'Es ist der am wenigsten genutzte öffentliche Raum und bietet Benutzer, die verschiedene Wettbewerbe gewonnen haben.', '', '');
INSERT INTO `catalog_pages` VALUES (163, 107, 'guild_forum', 'groups_forums', 'Gruppenforen', 1, 207, 1, 0, 2, '1', '1', '0', '0', NULL, '<p><strong>Was sind Gruppenforen?</strong></p>\r\n<p>Foren ermöglichen es euch, Themen mühelos frei zu posten, zu kommentieren und zu diskutieren, ohne das Hotel zu verlassen!</p>\r\n<p><strong>Wer kann ein Forum eröffnen?</strong></p>\r\n<p>Nur ein Gruppenbesitzer kann ein Forum für seine Gruppe eröffnen.</p>\r\n<p><strong>Benötige ich ein Forum-Terminal?</strong></p>\r\n<p>Ja: Um ein Gruppenforum zu starten, muss der Gruppenbesitzer zunächst ein Forum-Terminal für die Gruppe erwerben. </p>\r\n<p><strong> Bitte beachte, dass wir dieser Funktion in naher Zukunft weitere Funktionen hinzufügen werden.</strong></p>', '', 'catalog_groups_en', '', 'Gruppenforen sind da!', '', '');
INSERT INTO `catalog_pages` VALUES (167, 209, 'default_3x3', 'usva', 'USVA', 1, 129, 1, 0, 118, '1', '1', '0', '0', '', '', '', 'catalog_header_USVA', 'Catalog_teaser_USVA', 'Mit einer Vielzahl von Farben und neuen Stapelmöglichkeiten werden Sie es lieben, Strukturen mit der neuen Furni-Linie von USVA zu bauen und zu schaffen!', '', '');
INSERT INTO `catalog_pages` VALUES (179, 568, 'default_3x3', 'pura', 'Pura', 1, 48, 1, 0, 13, '1', '1', '0', '0', NULL, '', '', 'puraheader', 'catalog_pura_teaser1', 'Diese Kollektion atmet reine und frische Luft und frische Ruhe. Nutzen Sie es, um einen Zufluchtsort abseits der Hektik der öffentlichen Räume oder Ihres Lebens außerhalb des Hotels zu schaffen.', '', '');
INSERT INTO `catalog_pages` VALUES (182, 568, 'default_3x3', 'bathroom', 'Bad', 1, 17, 1, 0, 3, '1', '1', '0', '0', '', '', '', 'bathroom_catahead', 'bcbath_catateaser', 'Geben Sie sich und Ihren Gästen einen Platz zum Abkühlen, was wichtig ist, wenn Sie schlechte Gerüche vermeiden möchten. Es könnte jedoch eine Idee sein, Ihr Badezimmer in eine Ecke zu stellen.', '', '');
INSERT INTO `catalog_pages` VALUES (187, 253, 'default_3x3', 'trax_machines', 'Trax-Maschine', 1, 257, 1, 0, 13, '1', '1', '0', '0', ' ', '', '', 'music_header', 'catalog_djshop_teaser1', 'Machen wir uns laut! Trax ist ein altes und bekanntes Feature von Habbo, wo Sie Ihre eigenen Tracks mischen und mit dem Pumpen beginnen können. Ohne ist es nicht dasselbe, aber zumindest sind die Maschinen noch verfügbar!', '', '');
