INSERT INTO `catalog_pages` VALUES (200, 3, 'default_3x3', 'outfits', 'Kostüme', 6, 74, 1, 0, 3, '1', '1', '0', '0', '', '', '', '', 'tradeableclothing_teaser', 'Unterschiedliche Anlässe erfordern unterschiedliche Outfits. Um es zu tragen, legen Sie einfach den neuen Artikel in Ihr Zimmer und doppelklicken Sie, um die oufit-Kleidung an Ihren Avatar zu binden', '', '');
