INSERT INTO `catalog_pages` VALUES (202, 3, 'default_3x3', 'hats', 'Hüte', 6, 74, 1, 0, 5, '1', '1', '0', '0', '', '', '', '', 'tradeableclothing_teaser', 'Bleiben Sie auf dem Laufenden mit ALLEN aktuellen Kopfbedeckungen! Um es zu tragen, legen Sie einfach den neuen Artikel in Ihr Zimmer und doppelklicken Sie, um die oufit-Kleidung an Ihren Avatar zu binden', '', '');
INSERT INTO `catalog_pages` VALUES (203, 3, 'default_3x3', 'dresses', 'Kleider', 6, 74, 1, 0, 7, '1', '1', '0', '0', '', '', '', '', 'tradeableclothing_teaser', 'Kleide dich, um mit diesen wunderschönen, fachmännisch gefertigten Kleidern zu beeindrucken! Zum Anziehen lege den neuen Artikel einfach in dein Zimmer und doppelklicke, um die oufit-Kleidung an deinen Avatar zu binden', '', '');
INSERT INTO `catalog_pages` VALUES (204, 3, 'default_3x3', 'shirts', 'Hemden', 6, 74, 1, 0, 8, '1', '1', '0', '0', '', '', '', '', 'tradeableclothing_teaser', 'Als etwas intelligentere Option werden unsere Shirts Ihre Freunde begeistern! Zum Anziehen lege den neuen Artikel einfach in dein Zimmer und doppelklicke, um die oufit-Kleidung an deinen Avatar zu binden', '', '');
INSERT INTO `catalog_pages` VALUES (205, 3, 'default_3x3', 'jackets', 'Jacken', 6, 74, 1, 0, 9, '1', '1', '0', '0', '', '', '', '', 'tradeableclothing_teaser', 'Ziehen Sie es warm ein, aber halten Sie es super stilvoll mit unserer Auswahl an Jacken. Zum Anziehen lege den neuen Artikel einfach in dein Zimmer und doppelklicke, um die oufit-Kleidung an deinen Avatar zu binden', '', '');
INSERT INTO `catalog_pages` VALUES (206, 3, 'default_3x3', 'trousers', 'Hose', 6, 74, 1, 0, 10, '1', '1', '0', '0', '', '', '', '', 'tradeableclothing_teaser', 'Untere Hälfte Kleidung für die etwas kälteren Tage. Zum Anziehen lege den neuen Artikel einfach in dein Zimmer und doppelklicke, um die oufit-Kleidung an deinen Avatar zu binden', '', '');
