INSERT INTO `catalog_pages` VALUES (219, 2, 'pets3', 'game_shop', 'Spiele', 1, 202, 1, 0, 16, '0', '1', '0', '0', '', '', '', 'game_shop_header', 'game_shop_teaser', 'Zieh deine Gamer-Ausrüstung an!', '', '');
INSERT INTO `catalog_pages` VALUES (220, 1411, 'pets3', 'marketplace', 'Flohmarkt', 1, 69, 1, 0, 10, '1', '1', '0', '0', 'How does the Habbo Marketplace work?', 'Buying items: Browse for the item you want to buy on the Marketplace Offers page and click Buy. We guarantee you\'ll get the item at the cheapest price available at the moment of purchase. No requirements needed.\r\n\r\nSelling items: You can sell any item which is tradable by selecting the item in your inventory and clicking on \'Sell in Marketplace\'. You also can use items currently in the Shop.\r\n\r\nNOTE: you can only sell 250 furni at a time.\r\n\r\nRequirements: To sell your Furni in the Marketplace you\'ll need a Trading Pass, which you can get completing the first steps of the Talent Track.', '', 'catalog_marketplace_header_en', 'catalog_note_marketplace', 'Habbo Marketplace ist eine bequeme und sichere Möglichkeit, Artikel in Habbo zu kaufen und zu verkaufen.', '', '');
INSERT INTO `catalog_pages` VALUES (221, 4, 'pets3', 'baby_pet_animals', 'Baby Haustiere', 1, 228, 1, 0, 2, '1', '1', '0', '0', 'Sie sind süß. Sie sind hier, um eure Herzen zu gewinnen. Wer sind sie? Baby-Haustiere! GANZ NEU Kätzchen, Welpen, Ferkel stürmen ihren Weg durch das Hotel und schließen sich den Bärenjungen und Terriern an.', '<p><strong>Kaufe dir dein treues Haustier und trainiere es! Sie sind freundlich.</strong></p>', 'Click your Pet and hit the \"Train\" button to get a list of commands that will level up your Pet in no time!', 'babypets_cata_header', 'ctlg_babypet_note', 'Sie sind süß. Sie sind hier, um eure Herzen zu gewinnen. Wer sind sie? Baby-Haustiere! GANZ NEU Kätzchen, Welpen, Ferkel stürmen ihren Weg durch das Hotel und schließen sich den Bärenjungen und Terriern an.', '', '');
INSERT INTO `catalog_pages` VALUES (222, 5, 'pets3', 'builders_club', 'Konstruktion', 1, 28, 1, 0, 2, '1', '1', '0', '0', '1 Bloque... 2 Bloque... Rojo\nBloque... ¡Bloque azul!', 'Con docenas de todos los colores y patrones para elegir, ¡realmente puedes dejar volar tu creatividad!\nExclusivo del Club de Constructores.', '', 'block_header', 'ctlg_bclub_note', '1 Block... 2 Block... Rot\nBlock... Blauer Block!', '', '');
INSERT INTO `catalog_pages` VALUES (223, 602, 'default_3x3', 'backgrounds', 'Wolken', 1, 225, 1, 0, 5, '1', '1', '0', '0', '', '', '', 'catalog_header_easter14_001', 'catalog_shal_teaser_da', 'Stellen Sie die Szene in Ihrem Raum mit einem dieser Hintergründe richtig ein.', '', '');
INSERT INTO `catalog_pages` VALUES (224, 568, 'default_3x3', 'teleports', 'Teleporter', 1, 120, 1, 0, 15, '1', '1', '0', '0', '', NULL, 'Haga clic en un elemento para obtener más detalles.', 'catalog_doors_headline1', 'catalog_door_a', 'Transportiere dich mit unseren Teleportern des Weltraumzeitalters von Raum zu Raum. Kaufen Sie ein Paar, platzieren Sie eines in jedem Zimmer und Sie haben Ihre eigene Suite! WICHTIG: Teleports werden immer paarweise verkauft, mit Ausnahme des zufälligen Banzai-Teleports.', '', '');
INSERT INTO `catalog_pages` VALUES (225, 568, 'trophies', 'trophies', 'Trophäen', 1, 221, 1, 0, 17, '1', '1', '0', '0', '', '', '', 'trophies', '', 'Jeder ist ein Gewinner, Schatz! Und jetzt können Sie sie alle mit unserer fabelhaften und glänzenden Sammlung von Bronze-, Silber- und Goldtrophäen belohnen.\r\n\r\nWählen Sie zunächst das Trophäenmodell aus, indem Sie auf die Pfeile klicken. Wählen Sie dann das Metall aus. Schreiben Sie Ihren Beitrag unten und wir werden ihn zusammen mit Ihrem Namen und dem heutigen Datum auf die Trophäe gravieren.\r\nDenken Sie daran: Es ist dauerhaft!', '', '');
INSERT INTO `catalog_pages` VALUES (226, 378, 'default_3x3', 'easter_2020', 'Ostern 2020', 1, 181, 1, 0, 38, '1', '1', '0', '0', NULL, NULL, NULL, 'catalog_easter_headline1', 'easternew', 'Richten Sie einen Campingplatz am Fluss ein, nichts ist besser als die Natur. Machen Sie Ihren Campingplatz noch heute perfekt!', '', '');
INSERT INTO `catalog_pages` VALUES (227, 219, 'pets2', 'how_to_play_banzai', 'Wie man Battle Banzai spielt', 1, 10, 1, 0, 2, '1', '1', '0', '0', 'So erstellst du deine eigene Battle Banzai Arena:', '<p>1. Lege Banzai Platten auf den Boden und schütze das Spielfeld.</p>\r\n<p><br>2. Füge ein Teamportal für jedes Team hinzu (max. 4: blau, pink, gelb und grün)</p>\r\n<p><br>3. Platziere einen Spielstein und Markierungen auf dem Spielfeld. </p>\r\n<p><br>4. Klicke auf den Zähler, um das Spiel zu starten! Springe auf die Platten, um sie zu färben, springe dreimal, um sie zu blockieren</p>\r\n<p><br>– das Team mit den meisten Punkten gewinnt! </p>\r\n<p><br><strong>Tipp:</strong> Füge Pyramiden, Drachen und Scheiben Dramatik hinzu – sie funktionieren sowohl als Hindernisse als auch als Helfer!</p>', '', 'catalog_battleBanzai_header_en', 'catalog_battleBanzai_teaser', 'Wie funktioniert das? Lesen Sie die Anweisungen hier und Sie werden Banzai in kürzester Zeit spielen!', '', '');
INSERT INTO `catalog_pages` VALUES (228, 219, 'pets2', 'how_to_play_freeze', 'Wie man Freeze spielt', 1, 10, 1, 0, 4, '1', '1', '0', '0', 'Wie man Freeze spielt', '<p>1. Platziere Platten und Blöcke in deinem Raum. Lege immer Blöcke auf die Platten! Füge Teamtore, einen Zähler, ein Ausgangsplättchen und Markierungen hinzu.<br> <br>2. Bereit? Lass deine Freunde ein Team wählen. Jedes Team kann bis zu fünf Spieler haben. Dann klickst du auf den Zähler, um zu beginnen! </p>\r\n<p>3. Um einen Schneeball zu platzieren, doppelklickst du auf die Platte, auf der du stehst, oder doppelklickst auf eine Platte neben dir. Pop-Blöcke für Power-Ups! </p>\r\n<p>4. Das letzte Team, das noch steht, gewinnt! </p>\r\n<p><strong>Denke daran:</strong> Du wirst zu einem Ausgangsplättchen teleportiert, wenn du alle Leben verloren hast.</p>', '', 'catalog_freeze_en', 'ctlg_pet_note', 'Finden Sie heraus, wie Sie Ihr eigenes Freeze erstellen und hosten können! Ich spiele, indem ich die folgenden Anweisungen lese!', '', '');
INSERT INTO `catalog_pages` VALUES (229, 8, 'default_3x3', 'club_shop', 'Club-Shop', 1, 214, 1, 0, 4, '1', '1', '0', '0', '', '', '', 'catalog_header_hc', 'teaser_habboclub', '', '', '');
INSERT INTO `catalog_pages` VALUES (230, 277, 'pets', 'haloompa', 'Haloompa', 1, 455, 1, 0, 7, '1', '1', '0', '0', '', '', '', '', '', 'Einmal gekauft und platziert, erhalten Sie durch Klicken darauf ein besonderes Haustier.', '', '');
INSERT INTO `catalog_pages` VALUES (231, 604, 'default_3x3', 'wall_decorations', 'Wanddekoration', 1, 219, 1, 0, 10, '1', '1', '0', '0', '', '', '', 'catalog_gallery_headline1', 'catalog_posters_teaser1', 'Schmücken Sie die Wände mit wunderschönen Kunstwerken, Postern, Plaketten und Wandteppichen. Die Galerie ist vollgepackt mit Artikeln für jeden Geschmack, von Kitsch bis Moderne, von Tradition bis Moderne.', '', '');
INSERT INTO `catalog_pages` VALUES (232, 277, 'single_bundle', 'pterodactyl', 'Pterodactylus Haustier', 1, 260, 1, 0, 21, '1', '1', '0', '0', '', '', '', 'jurassic15_catalog_header', 'dino_pets', 'Diese tollen Haustiere haben ein wildes Aussehen mit langen Krallen und scharfen Zähnen, aber ihre süße Natur scheint immer durch! Ultra entspannt, lieben diese \"fliegenden Eidechsen\" nichts mehr, als Zeit mit ihrem Besitzer zu verbringen, durch den Hotelhimmel zu schweben und ihr Lieblingsessen zu essen ... Das bescheidene Grünkohlblatt.', '', '');
INSERT INTO `catalog_pages` VALUES (233, 5, 'default_3x3', 'room_bundles', 'Zimmer-Paket', 1, 206, 1, 0, 5, '0', '0', '0', '0', NULL, '', '', 'catalog_header_roombundle', '', NULL, 'bundlerooms', '');
