INSERT INTO `catalog_pages` VALUES (359, 387, 'default_3x3', 'classic_lounge', 'Classic Lounge', 1, 927, 1, 0, 2, '1', '1', '0', '0', '', '', '', 'catalog_header_classics', 'classiclounge', 'Die Welcome Lounge beherbergt nicht nur neuere Spieler, sondern auch alte Habbo-Originale, die kommen, um die neueren Spieler zu führen oder einfach nur mit ihren Freunden zu chillen.', '', '');
