INSERT INTO `catalog_pages` VALUES (361, 387, 'default_3x3', 'battleball', 'Kampfball', 1, 927, 1, 0, 15, '1', '1', '0', '0', '', '', '', 'catalog_header_classics', 'spromo_Blue_BB', 'Das Battleball-Spiel wurde zusammen mit Snowstorm aus Habbo entfernt, da Sulake beschloss, sich mehr auf die Verbesserung anderer Teile des Hotels zu konzentrieren. ', '', '');
INSERT INTO `catalog_pages` VALUES (362, 387, 'default_3x3', 'ice_cafe', 'Eiscafé', 1, 927, 1, 0, 5, '1', '1', '0', '0', '', '', '', 'catalog_header_classics', 'classic5_furnis', 'Das Ice Cafe wurde als Treffpunkt in Habbo Experience für Chaplin und seine Freunde genutzt.', '', '');
